            <div className="innerBox">
                <h2>Body Mass Index (BMI) = {}</h2>
                <h3>{}</h3>

                <div className="InputWrap">
                    <InputField 
                        label="Height (in.)"
                        placeholder="Enter your height"  

                    />
                    <InputField 
                        label="Weight (ibs.)"
                        placeholder="Enter your weight"
                    />

                </div>
                <button>RESET</button>
            </div>
        )
    }
}
